import React from "react";
import styled from "styled-components";
import QR from "../../assets/qr.png";
import Transfer from "../../assets/transfer.png";
import BankTransfer from "../../assets/bank.png";
import Bill from "../../assets/bill.png";
import Adil from "../../assets/adil.jpg";

export default function MiddleScan() {
  return (
    <>
      <div>
        <MiddleFirst>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={QR} alt="QR" />
            </EachMiddleImgCont>
            <P>
              Scan any <br /> QR code
            </P>
          </EachMiddle>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={Transfer} alt="Transfer" />
            </EachMiddleImgCont>
            <P>
              Send <br /> money
            </P>
          </EachMiddle>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={BankTransfer} alt="Bank Transfer" />
            </EachMiddleImgCont>
            <P>
              Bank <br /> Transfer
            </P>
          </EachMiddle>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={Bill} alt="Bill" />
            </EachMiddleImgCont>
            <P>
              Recharge <br /> and bills
            </P>
          </EachMiddle>
        </MiddleFirst>
        <Upiid>UPI ID: adilkt16@oksbi</Upiid>

        <MiddleSecond>
          <H3>People</H3>
          <AllPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <img src={Adil} alt="Each person" />
              </PeopleImgCont>
              <p>Fayez</p>
            </EachPeople>
          </AllPeople>
        </MiddleSecond>
      </div>
    </>
  );
}

const MiddleFirst = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  text-align: center;
  font-size: 12px;
  padding: 10px 0;
  margin: 0 20px;
`;
const EachMiddle = styled.div``;
const EachMiddleImgCont = styled.div`
  background-color: #d6efff;
  padding: 10px;
  border-radius: 10px;
  margin-bottom: 5px;
`;
const P = styled.p`
  color: black;
  line-height: 16px;
`;
const Upiid = styled.p`
  font-size: 12px;
  text-align: center;
  margin: 10px auto 0;
  background-color: #d6efff;
  width: fit-content;
  padding: 4px 12px;
  border-radius: 10px;
  display: block;
`;

const MiddleSecond = styled.div`
  margin: 30px 20px;
`;
const H3 = styled.h3`
  font-size: 20px;
  font-weight: normal;
`;
const AllPeople = styled.div`
  display: flex;
  align-items: center;
  flex-wrap: wrap;
`;
const EachPeople = styled.div`
  width: 25%;
`;
const PeopleImgCont = styled.div`
  width: 25px;
  display: block;
`;
